description:
This is the entire first season form 2008 including Episode 7 which did not air on TV.



Swift and Shift Couriers is a fully sick Australian comedy television series that first screened on SBS TV in October 2008. The nine-part series is produced, directed and written by Paul Fenech, who was also responsible for the comedy series Pizza. The series is set around the staff who work at the \\\'Swift and Shift\\\' Courier Company, in the central business district of Sydney. Episodes have been partly filmed in Egypt and Thailand.


